import React from "react";

function About() {
    return (
        <section>
            <div className="center">
                <h1>About Me</h1>
            </div>
            <p>Welcome! My name is Ashley Trollinger and I am currently in a program working to become a Full Stack developer! I was born in Atlanta, Georgia and currently live in Harrisonburg, Virginia with my puppy Skip-Beau. I work as a Guest Service Supervisor at Massanutten Water Park and hope to relocate somewhere new to explore. I enjoy deigning appealing, clean UI as well as "breaking the code" and doing some backend work. </p>
        </section>
    );
}

export default About;
